import React, { useState } from "react";
import "./Counter.css";



function Counter(){

    const [count, setCount] = useState(0);

    function handleClick(){
        setCount(count+1);
    }
    return <div>
        <button onClick="handleClick">+1</button>
        <span>{count}</span>
    </div>
};

export default Counter;
